import React from "react"

const toDoList = ({toDo, setToDo}) => {

  return (
  <div>
   {toDo.map((todo) => (
    <li className="todo-List" key={todo.id}>
        <input 
        type="text"
        value={todo.title}
        className="list"
        onChange={(event) => event.preventDefault()}
        />
    <div>
        <button className="button-Complete task-Button"></button>
        <i className="fa"></i>
    </div>
    </li>
   ))}
  </div>
  )

}

export default toDoList
